function ViewUserModal(props) {
    const { showModalViewUser, setShowModalViewUser} = useContext(AppContext);
  return (
    <>
      <ModalComponent titleModal={"Visualizar Usuário"} >
        <h2>teste</h2>
      </ModalComponent>
    </>
  );
}

export default ViewUserModal;
